  \"2015-11-20T22:42:39.493612\",\n\t\"name\": \"ejscreen-supplementary-indexes-2015-public\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"There are 40 supplementary EJSCREEN indexes
  that are divided into 5 categories: EJ Index with supplementary demographic index,
  Supplementary EJ Index 1 with demographic index, Supplementary EJ Index 1 with supplementary
  demographic index, Supplementary EJ Index 2 with demographic index, and Supplementary
  EJ Index 2 with supplementary demographic index. Each category covers the same eight
  environmental indicators of Particulate Matter (PM2.5), Ozone Traffic Proximity
  and Volume, Lead Paint Indicator, Proximity to Risk Management Plan Sites, Proximity
  to National Priorities List Sites, Proximity to Treatment Storage and Disposal Facilities,
  and Proximity to Major Direct Water Dischargers.\",\n\t\"license_title\": null,\n\t\"extras\":
